import React, { Fragment } from 'react';
import { Row,
         Form, 
         Input, 
         Button, 
         Checkbox, 
         Col, Card, 
         DatePicker, 
         InputNumber,
         Divider
         
} from 'antd';

const Upload = () => {
    const onFinish = (values) => {
        console.log('Success:', values);
    };
    
    const onFinishFailed = (errorInfo) => {
        console.log('Failed:', errorInfo);
    };

    return (


    <>   
        <Form 
            name="basic"
            labelCol={{
                span: 8,
            }}
            wrapperCol={{
                span: 16,
            }}
            initialValues={{
                remember: true,
            }}
            onFinish={onFinish}
            onFinishFailed={onFinishFailed}
            autoComplete="off">

            <Row justify="center" gutter={[16, 16]}>
                <Col span={4}>
                    <Card>
                        
                    </Card> 
                </Col>

                <Col span={4}>
                    <Card>

                    </Card>
                </Col>

                <Col span={4}>
                    <Card>

                    </Card>
                </Col>
            </Row>
    


    
            <Row justify="center" gutter={[16, 16]}>
                <Col span={4}>
                    <Card>
                            
                    </Card> 
                </Col>

                <Col span={4}>
                    <Card>

                    </Card>
                </Col>

                <Col span={4}>
                    <Card>

                    </Card>
                </Col>
            </Row>
        </Form>
            


    </>
        

        
    );
}

export default Upload;
